package operator;

public class relationaloperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=3;
		int b=5;
		int c=5;
		System.out.println(a!=b);
		System.out.println(a==b);
		System.out.println(a>b);
		System.out.println(a<b);
		System.out.println(b==c);
		System.out.println(c>a);
		System.out.println(a<=b);
		System.out.println(b>=c);
	}

}
